import React, { Component } from 'react';
import { Navbar, NavbarBrand } from 'reactstrap';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
       <Navbar dark color="black">
       <div className="container">
         <NavbarBrand href="/">Immeasurable</NavbarBrand>
                </div> 
             </Navbar>
      </div>
    );
  }
}

export default App;
